import React, { useState, useEffect } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import L from "leaflet";
import io from "socket.io-client";
import "leaflet/dist/leaflet.css";
import "./DroneMap.css"; // Add a CSS file for styling

const socket = io("http://localhost:8000"); // Connect to FastAPI WebSocket

const DroneMap = () => {
  const [droneData, setDroneData] = useState([]);
  const [webSocketStatus, setWebSocketStatus] = useState("üî¥ Disconnected");

  // Custom icons for Red & Green markers
  const redMarker = new L.Icon({
    iconUrl: "/images/red_marker.png",
    iconSize: [30, 40],
    iconAnchor: [15, 40],
  });

  const greenMarker = new L.Icon({
    iconUrl: "/images/green_marker.png",
    iconSize: [30, 40],
    iconAnchor: [15, 40],
  });

  // Fetch drone data initially
  useEffect(() => {
    fetch(`${process.env.REACT_APP_API_URL}/fetch-drones`)
      .then((response) => response.json())
      .then((data) => {
        if (data.drones) {
          setDroneData(data.drones);
        }
      })
      .catch((error) => console.error("Error fetching drone data: ", error));
  }, []);

  // WebSocket Real-time updates
  useEffect(() => {
    socket.on("connect", () => setWebSocketStatus("üü¢ Connected"));
    socket.on("disconnect", () => setWebSocketStatus("üî¥ Disconnected"));

    socket.on("drone_update", (updatedDrones) => {
      console.log("Live Drone Update:", updatedDrones);
      setDroneData(updatedDrones);
    });

    return () => socket.disconnect();
  }, []);

  // Find fastest and slowest drones
  const fastestDrone = droneData.reduce((prev, curr) =>
    prev.velocity > curr.velocity ? prev : curr
  );
  const slowestDrone = droneData.reduce((prev, curr) =>
    prev.velocity < curr.velocity ? prev : curr
  );

  return (
    <div className="map-container">
      {/* HEADER */}
      <div className="header">
        <h1>üöÅ Illegal Drone Traffic Tracking</h1>
        <p>Live tracking of drone activity using OpenSky API</p>
        <div className={`websocket-status ${webSocketStatus === "üü¢ Connected" ? "connected" : "disconnected"}`}>
          {webSocketStatus}
        </div>
      </div>

      {/* LEAFLET MAP */}
      <MapContainer center={[37.7749, -95.4194]} zoom={4} style={{ height: "600px", width: "100%" }}>
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
        {droneData.map((drone, index) => (
          <Marker key={index} position={[drone.latitude, drone.longitude]} icon={drone.velocity > 50 ? redMarker : greenMarker}>
            <Popup>
              <strong>Callsign:</strong> {drone.callsign} <br />
              <strong>Country:</strong> {drone.country} üåç<br />
              <strong>Altitude:</strong> {drone.altitude} meters üèîÔ∏è <br />
              <strong>Velocity:</strong> {drone.velocity} km/h üöÄ
            </Popup>
          </Marker>
        ))}
      </MapContainer>

      {/* DRONE LIST PANEL */}
      <div className="drone-list">
        <h2>üì° Live Drone Updates</h2>
        <ul>
          {droneData.map((drone, index) => (
            <li key={index} className={drone === fastestDrone ? "fastest" : drone === slowestDrone ? "slowest" : ""}>
              <strong>{drone.callsign}</strong> ({drone.country}) - 
              Lat: {drone.latitude}, Lon: {drone.longitude}, Alt: {drone.altitude}m, Vel: {drone.velocity} km/h
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default DroneMap;
